import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Home from './components/Home';
import Hospitals from './components/Hospitals';
import Medicals from './components/Medicals';
import Diagnostics from './components/Diagnostics';
import Search from './components/Search';

const App = () => {
  const hospitals = [
    { id: 1, name: 'Holy Family', type: 'Hospital' },
    { id: 2, name: 'Shruti Nursing', type: 'Hospital' },
    // Add more hospital data here
  ];

  const medicals = [
    { id: 1, name: 'Bandra Medical Store', type: 'Medical Store' },
    { id: 2, name: 'Shree Ganesh Medical', type: 'Medical Store' },
    // Add more medical data here
  ];

  const diagnostics = [
    { id: 1, name: 'Thyrocare', type: 'Diagnostic Lab' },
    { id: 2, name: 'Suburban Diagnostics', type: 'Diagnostic Lab' },
    // Add more diagnostics data here
  ];

  return (
    <Router>
      <div>
        <Navbar />
        <Search hospitals={hospitals} medicals={medicals} diagnostics={diagnostics} />
        <Routes>
          <Route path="/" exact element={<Home />} />
          <Route path="/hospitals" element={<Hospitals />} />
          <Route path="/medicals" element={<Medicals />} />
          <Route path="/diagnostics" element={<Diagnostics />} />
        </Routes>
        <Footer />
      </div>
    </Router>
  );
};

export default App;
